import React from 'react'

class Products extends React.Component {
constructor(props){
    super(props)
    this.state = {data : this.renderUI("https://60ae0d5e80a61f00173324bc.mockapi.io/products")}
}
renderUI = async (url) => {
    let res = await fetch(url);
    let data = await res.json();
    return data
}

consolez = () => {
    return this.state.map(el =>{
        return (
    <div class="product-container">
    <img src={el.image} alt=""/>
    <p class="product-name">{el.name}</p>
    <p>{el.errorDescription}</p>
    <p>ID: <span>{el.id}</span></p>
    <p>Color : <span>{el.color}</span></p>
    <h3>SKU: <span>${el.sku}</span></h3>
    </div>
        )
    })
}
      // 


    render(){
        return(
           <div>{this.consolez()}</div>
        )
    }
}
export default Products
